import React, { useEffect } from "react";
import Link from "next/Link";

function Page() {
  const notes = new Array(10).fill(1).map((e, i) => ({ id: i, title: `Note: ${i}` }));

  return (
    <div>
      <h1>All notes here</h1>

      {notes.map((note) => (
        <div>
          <Link key={note.id} href="/notes/[id]" as={`/notes/${note.id}`}>
            <a>
              <strong>Click on Notes</strong>{" "}
            </a>
          </Link>
        </div>
      ))}
    </div>
  );
}

export default Page;
